<?php die(); ?>#(^-^)#{"__meta":{"id":"Xb46bc9d0c13a6361e4e28e63ff0fad4b","datetime":"2022-07-23 15:45:04","utime":1658571304.524083,"method":"POST","uri":"\/aisha\/administrator\/index.php?option=com_content&layout=edit&id=558","ip":"::1"},"info":{"phpVersion":"7.4.30","joomlaVersion":"4.1.5","requestId":"Xb46bc9d0c13a6361e4e28e63ff0fad4b","identity":{"type":"user","id":222,"name":"Astro Isha","username":"luffy22"},"response":{"status_code":200},"template":{"template":"atum","home":"","id":""},"database":{"dbserver":"mysql","dbversion":"8.0.29-0ubuntu0.20.04.3","dbcollation":"utf8mb4_0900_ai_ci","dbconnectioncollation":"utf8mb4_0900_ai_ci","dbconnectionencryption":"","dbconnencryptsupported":true}},"memory":{"peak_usage":4843472,"peak_usage_str":"5MB"},"request":{"$_GET":"array:3 [\n  \"option\" => \"com_content\"\n  \"layout\" => \"edit\"\n  \"id\" => \"558\"\n]","$_POST":"array:5 [\n  \"jform\" => array:29 [\n    \"title\" => \"Kulavardhana Yoga\"\n    \"alias\" => \"kulvardhana\"\n    \"articletext\" => \"\"\"\n      <div class=\"mb-3\">&nbsp;<\/div>\\r\\n\n      <div class=\"lead alert alert-dark\">What is Kulvardhana Yoga?<\/div>\\r\\n\n      <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Kulvardhana Yoga is yoga mentioned in B. V. Raman's 300 Important Combinations. <strong>Kul<\/strong> means family lineage and <strong>Vardhana<\/strong> means growth in sanskrit. Kulvardhana roughly translates to a continuous growth in family lineage via able sons\/daughters as well as grand sons\/grand daughters. Sun, Moon, Ascendant and fifth house are involved in this yoga.<\/p>\\r\\n\n      <div class=\"lead alert alert-dark\">How is Kulvardhana Yoga formed?<\/div>\\r\\n\n      <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;For Kulvardhana Yoga to occur all planets must be located in fifth house counted from ascendant, Moon or Sun. Here is a simple way to go about finding out about this yoga.<\/p>\\r\\n\n      <ol>\\r\\n\n      <li>See if fifth house from ascendant contains planets.<\/li>\\r\\n\n      <li>See if fifth house from Moon and Sun contains remaining planets.<\/li>\\r\\n\n      <\/ol>\\r\\n\n      <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;As long as all planets are located in fifth from ascendant, Moon and Sun this yoga will occur.<\/p>\\r\\n\n      <div class=\"lead alert alert-dark\">Examples Of Kulvardhana Yoga<\/div>\\r\\n\n      <ul class=\"nav nav-pills\">\\r\\n\n      <li class=\"nav-item\"><a href=\"#north-558\" class=\"nav-link active\" data-toggle=\"tab\">North Style<\/a><\/li>\\r\\n\n      <li class=\"nav-item\"><a href=\"#south-558\" class=\"nav-link\" data-toggle=\"tab\">South Style<\/a><\/li>\\r\\n\n      <\/ul>\\r\\n\n      <div class=\"tab-content\">\\r\\n\n      <div class=\"mb-3\">&nbsp;<\/div>\\r\\n\n      <div id=\"north-558\" class=\"tab-pane active\"><img src=\"images\/yoga_img\/kulvardhana_yoga_n.jpg\" alt=\"kulvardhana\" title=\"kulvardhana yoga north\" \/><\/div>\\r\\n\n      <div id=\"south-558\" class=\"tab-pane\"><img src=\"images\/yoga_img\/kulvardhana_yoga_s.jpg\" alt=\"kulvardhana\" title=\"kulvardhana yoga south\" \/><\/div>\\r\\n\n      <\/div>\\r\\n\n      <div class=\"mb-3\">&nbsp;<\/div>\\r\\n\n      <div class=\"lead alert alert-dark\">Results of Kulvardhana Yoga<\/div>\\r\\n\n      <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Person born with Kulvardhana Yoga are wealthy, healthy and long-lived. Their sons\/daughters and grand sons\/grand daughters are able to carry on their glorious family legacy forward and achieve similar success and fame.<\/p>\\r\\n\n      <div class=\"lead alert alert-dark\">Remarks on Kulvardhana Yoga<\/div>\\r\\n\n      <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Its not necessary for all planets to be in fifth house to get effects of Kulvardhana Yoga. Sometimes strong planets influencing ascendant, fifth house and ninth house can produce similar effects.<\/p>\\r\\n\n      <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Ninth house deals with family legacy as well as fortune while fifth house deals with children and fame. Having strength in ninth house implies native comes from a great family lineage and is fortunate. Having strength in fifth house would imply wise and intelligent children as well as abundant fame.<\/p>\\r\\n\n      <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Shree Ram had exalted Jupiter in ascendant(Cancer) and aspecting friendly sign in fifth house(Scorpio) and own-sign in ninth house(Pisces). He was born in the great Raghu dyasty where likes of Ishvaku and Harischandra were born. His two sons Luv and Kush built cities and added to glory of Raghu dyasty. Shree Ram himself achieved unparallel feats like defeating Ravana. And yet technically Kulvardhana Yoga didn't occur in his horoscope.<\/p>\n      \"\"\"\n    \"transition\" => \"\"\n    \"state\" => \"1\"\n    \"catid\" => \"14\"\n    \"featured\" => \"0\"\n    \"access\" => \"1\"\n    \"language\" => \"*\"\n    \"note\" => \"\"\n    \"version_note\" => \"\"\n    \"images\" => array:8 [\n      \"image_intro\" => \"\"\n      \"image_intro_alt\" => \"\"\n      \"float_intro\" => \"\"\n      \"image_intro_caption\" => \"\"\n      \"image_fulltext\" => \"images\/art_img\/kulvardhana_title.jpg\"\n      \"image_fulltext_alt\" => \"\"\n      \"float_fulltext\" => \"\"\n      \"image_fulltext_caption\" => \"\"\n    ]\n    \"urls\" => array:9 [\n      \"urla\" => \"\"\n      \"urlatext\" => \"\"\n      \"targeta\" => \"\"\n      \"urlb\" => \"\"\n      \"urlbtext\" => \"\"\n      \"targetb\" => \"\"\n      \"urlc\" => \"\"\n      \"urlctext\" => \"\"\n      \"targetc\" => \"\"\n    ]\n    \"attribs\" => array:27 [\n      \"article_layout\" => \"\"\n      \"show_title\" => \"\"\n      \"link_titles\" => \"\"\n      \"show_tags\" => \"\"\n      \"show_intro\" => \"\"\n      \"info_block_position\" => \"\"\n      \"info_block_show_title\" => \"\"\n      \"show_category\" => \"\"\n      \"link_category\" => \"\"\n      \"show_parent_category\" => \"\"\n      \"link_parent_category\" => \"\"\n      \"show_author\" => \"\"\n      \"link_author\" => \