AND `m`.`content_item_id` IN (:preparedArray1)","params":{":preparedArray1":{"value":558,"dataType":"int","length":0,"driverOptions":[]},":prefix":{"value":"com_content.article","dataType":"string","length":0,"driverOptions":[]}},"duration_str":"144\u03bcs","memory_str":"1.63KB","caller":"\/var\/www\/html\/aisha\/libraries\/src\/Helper\/TagsHelper.php:439","callstack":[],"explain":[],"explain_col":[],"profile":[]},{"sql":"SHOW FULL COLUMNS FROM `jv_content`","params":[],"duration_str":"1.28ms","memory_str":"10.39KB","caller":"\/var\/www\/html\/aisha\/libraries\/src\/Table\/Table.php:908","callstack":[],"explain":[],"explain_col":[],"profile":[]},{"sql":"UPDATE `jv_content` SET `title`='Kulavardhana Yoga',`alias`='kulvardhana',`introtext`='<div class=\\\"mb-3\\\">&nbsp;<\/div>\\r\\n<div class=\\\"lead alert alert-dark\\\">What is Kulvardhana Yoga?<\/div>\\r\\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Kulvardhana Yoga is yoga mentioned in B. V. Raman\\'s 300 Important Combinations. <strong>Kul<\/strong> means family lineage and <strong>Vardhana<\/strong> means growth in sanskrit. Kulvardhana roughly translates to a continuous growth in family lineage via able sons\/daughters as well as grand sons\/grand daughters. Sun, Moon, Ascendant and fifth house are involved in this yoga.<\/p>\\r\\n<div class=\\\"lead alert alert-dark\\\">How is Kulvardhana Yoga formed?<\/div>\\r\\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;For Kulvardhana Yoga to occur all planets must be located in fifth house counted from ascendant, Moon or Sun. Here is a simple way to go about finding out about this yoga.<\/p>\\r\\n<ol>\\r\\n<li>See if fifth house from ascendant contains planets.<\/li>\\r\\n<li>See if fifth house from Moon and Sun contains remaining planets.<\/li>\\r\\n<\/ol>\\r\\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;As long as all planets are located in fifth from ascendant, Moon and Sun this yoga will occur.<\/p>\\r\\n<div class=\\\"lead alert alert-dark\\\">Examples Of Kulvardhana Yoga<\/div>\\r\\n<ul class=\\\"nav nav-pills\\\">\\r\\n<li class=\\\"nav-item\\\"><a href=\\\"#north-558\\\" class=\\\"nav-link active\\\" data-toggle=\\\"tab\\\">North Style<\/a><\/li>\\r\\n<li class=\\\"nav-item\\\"><a href=\\\"#south-558\\\" class=\\\"nav-link\\\" data-toggle=\\\"tab\\\">South Style<\/a><\/li>\\r\\n<\/ul>\\r\\n<div class=\\\"tab-content\\\">\\r\\n<div class=\\\"mb-3\\\">&nbsp;<\/div>\\r\\n<div id=\\\"north-558\\\" class=\\\"tab-pane active\\\"><img src=\\\"images\/yoga_img\/kulvardhana_yoga_n.jpg\\\" alt=\\\"kulvardhana\\\" title=\\\"kulvardhana yoga north\\\" \/><\/div>\\r\\n<div id=\\\"south-558\\\" class=\\\"tab-pane\\\"><img src=\\\"images\/yoga_img\/kulvardhana_yoga_s.jpg\\\" alt=\\\"kulvardhana\\\" title=\\\"kulvardhana yoga south\\\" \/><\/div>\\r\\n<\/div>\\r\\n<div class=\\\"mb-3\\\">&nbsp;<\/div>\\r\\n<div class=\\\"lead alert alert-dark\\\">Results of Kulvardhana Yoga<\/div>\\r\\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Person born with Kulvardhana Yoga are wealthy, healthy and long-lived. Their sons\/daughters and grand sons\/grand daughters are able to carry on their glorious family legacy forward and achieve similar success and fame.<\/p>\\r\\n<div class=\\\"lead alert alert-dark\\\">Remarks on Kulvardhana Yoga<\/div>\\r\\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Its not necessary for all planets to be in fifth house to get effects of Kulvardhana Yoga. Sometimes strong planets influencing ascendant, fifth house and ninth house can produce similar effects.<\/p>\\r\\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Ninth house deals with family legacy as well as fortune while fifth house deals with children and fame. Having strength in ninth house implies native comes from a great family lineage and is fortunate. Having strength in fifth house would imply wise and intelligent children as well as abundant fame.<\/p>\\r\\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Shree Ram had exalted Jupiter in ascendant(Cancer) and aspecting friendly sign in fifth house(Scorpio) and own-sign in ninth house(Pisces). He was born in the great Raghu dyasty where likes of Ishvaku and Harischandra were born. His two sons Luv and Kush built cities and added to glory of Raghu dyasty. Shree Ram himself achieved unparallel feats like defeating Ravana. And yet technically Kulvardhana Yoga didn\\'t occur in his horoscope.<\/p>',`fulltext`='',`state`='1',`catid`='14',`created`='2022-05-14 10:07:30',`created_by`='222',`created_by_alias`='',`modified`='2022-07-23 10:15:03',`modified_by`='222',`checked_out`='222',`checked_out_time`='2022-07-23 10:14:55',`publish_up`='2022-05-14 12:12:06',`publish_down`=NULL,`images`='{\\\"image_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"images\\\\\/art_img\\\\\/kulvardhana_title.jpg\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"float_fulltext\\\":\\\"\\\",\\\"image_fulltext_caption\\\":\\\"\\\"}',`urls`='{\\\"urla\\\":\\\"\\\",\\\"urlatext\\\":\\\"\\\",\\\"targeta\\\":\\\"\\\",\\\"urlb\\\":\\\"\\\",\\\"urlbtext\\\":\\\"\\\",\\\"targetb\\\":\\\"\\\",\\\"urlc\\\":\\\"\\\",\\\"urlctext\\\":\\\"\\\",\\\"targetc\\\":\\\"\\\"}',`attribs`='{\\\"article_layout\\\":\\\"\\\",\\\"show_title\\\":\\\"\\\",\\\"link_titles\\\":\\\"\\\",\\\"show_tags\\\":\\\"\\\",\\\"show_intro\\\":\\\"\\\",\\\"info_block_position\\\":\\\"\\\",\\\"info_block_show_title\\\":\\\"\\\",\\\"show_category\\\":\\\"\\\",\\\"link_category\\\":\\\"\\\",\\\"show_parent_category\\\":\\\"\\\",\\\"link_parent_category\\\":\\\"\\\",\\\"show_author\\\":\\\"\\\",\\\"link_author\\\":\\\"\\\",\\\"show_create_date\\\":\\\"\\\",\\\"show_modify_date\\\":\\\"\\\",\\\"show_publish_date\\\":\\\"\\\",\\\"show_item_navigation\\\":\\\"\\\",\\\"show_vote\\\":\\\"\\\",\\\"show_hits\\\":\\\"\\\",\\\"show_noauth\\\":\\\"\\\",\\\"urls_position\\\":\\\"\\\",\\\"alternative_readmore\\\":\\\"\\\",\\\"article_page_title\\\":\\\"\\\",\\\"show_publishing_options\\\":\\\"\\\",\\\"show_article_options\\\":\\\"\\\",\\\"show_urls_images_back